import './App.css';
import SearchBar from './Components/SearchBar';
import { Button, ButtonGroup } from '@material-ui/core';
import touristData from "./Data.json";
import styled from 'styled-components';




function App() {
  return (
    <div className="App">
     <h1> Tourist spots </h1>
     <ButtonGroup>
     <Button variant="contained">Cost</Button>
     <Button variant="contained">Location Type</Button>
     <Button variant="contained">Times</Button>
     <Button variant="contained">Distance</Button>
     <Button variant="contained">Guided Tours</Button>

     </ButtonGroup>
    



      <SearchBar placeholder="Enter tourist location" data={touristData}/>;
    </div>
  );
}

export default App;
